Por Charlie Ward.

As armadilhas de uma nova ordem mundial que nunca será alcançada.

 Dê um fim ao velho mundo, substituindo-o por uma nova maneira de fazer as coisas. O novo mundo, de acordo com seu entendimento, deveria ser chamado de "O Novo Mundo".  Ordem e controle.

 “Essa nova estrutura era para redistribuir a propriedade dos povos”.

 Os atributos imutáveis ​​da nova ordem mundial:

 1. Legalizar o casamento gay;
 2. Criar filhos longe de seus pais (pelo estado).
 3. Todas as mulheres devem ser empregadas pelo Estado e não podem ser “donas de casa”. »;
 4. O divórcio dos cônjuges deve ser sempre fácil e rápido.
 5. A instituição do casamento tradicional deve ser gradualmente descontinuada;
 6. Trabalhos. O governo deve se tornar o proprietário de todos os fatores de produção;
 7. O direito à propriedade privada deve ser declarado ilegal.
 8. A religião deve ser proibida. Elimine os crentes ou coloque-os na prisão;
 9. Crie uma nova religião voltada para a adoração do homem e de sua mente.  Todos deveriam acreditar nesta religião;

 Todas as guerras mundiais foram travadas para atingir esses objetivos, mas agora, quando a humanidade acorda, suas intenções estão falhando.  O poder de resistir ao mal e às mentiras desses monstros está em cada um de nós. E a vitória estará do nosso lado.

